let multiExpansionPanelInstance = null;
module.exports = class multi {

    constructor() {
        if (!multiExpansionPanelInstance) {
            multiExpansionPanelInstance = this;
            //set all other default values

            this.displayAs = 'Multiple Expansion';
            this.value = 'multi'
            this.type = 'TOGGLE';
            this.values = {'true-value':'true', 'false-value': 'false'}
        }
        return multiExpansionPanelInstance;
    }
}